import React from "react";
import  './navBar.css';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  }}));

const NavBar = () => {
  const classes = useStyles();
  return (
    <header className={classes.root}>
      <Grid container spacing={3} className="">
        <Grid item xs={12}>
        <a className="logo" >
        <span class="logoImg">
        <img src="./../../image/filmnet-logo.png" alt="logo"/>
        </span>
        </a>
          <ul className="navBar">
            <li className="navBarItem">1</li>
            <li className="navBarItem">2</li>
            <li className="navBarItem">3</li>
            <li className="navBarItem">4</li>
            <li className="navBarItem">5</li>
            <li className="navBarItem">6</li>
          </ul>
        </Grid>
      </Grid>
    </header>
  );
};
export default NavBar;
